    return getVerifyToken(reportCode).flatMapCompletable {
        contactTracingRepository.notifyInfected(it.token, jwtTokenUtils.getOnset(it.token))
    }.concatWith {
        preferencesRepository.setInfectionReportDate(Date())
        it.onComplete()
    }

}

